function woof_get_submit_link() {
    if (woof_is_ajax) {
        woof_current_values.page = woof_ajax_page_num
    }
    if (Object.keys(woof_current_values).length > 0) {
        jQuery.each(woof_current_values, function(index, value) {
            if (index == swoof_search_slug) {
                delete woof_current_values[index]
            }
            if (index == 's') {
                delete woof_current_values[index]
            }
            if (index == 'product') {
                delete woof_current_values[index]
            }
            if (index == 'really_curr_tax') {
                delete woof_current_values[index]
            }
        })
    }
    if (Object.keys(woof_current_values).length === 2) {
        if (('min_price' in woof_current_values) && ('max_price' in woof_current_values)) {
            woof_current_page_link = woof_current_page_link.replace(new RegExp(/page\/(\d+)\//), "");
            var l = woof_current_page_link + '?min_price=' + woof_current_values.min_price + '&max_price=' + woof_current_values.max_price;
            if (woof_is_ajax) {
                history.pushState({}, "", l)
            }
            return l
        }
    }
    if (Object.keys(woof_current_values).length === 0) {
        if (woof_is_ajax) {
            history.pushState({}, "", woof_current_page_link)
        }
        return woof_current_page_link
    }
    if (Object.keys(woof_really_curr_tax).length > 0) {
        woof_current_values.really_curr_tax = woof_really_curr_tax.term_id + '-' + woof_really_curr_tax.taxonomy
    }
    var link = woof_current_page_link + "?" + swoof_search_slug + "=1";
    if (!woof_is_permalink) {
        if (woof_redirect.length > 0) {
            link = woof_redirect + "?" + swoof_search_slug + "=1";
            if (woof_current_values.hasOwnProperty('page_id')) {
                delete woof_current_values.page_id
            }
        } else {
            link = location.protocol + '//' + location.host + "?" + swoof_search_slug + "=1"
        }
    }
    var woof_exclude_accept_array = ['path'];
    if (Object.keys(woof_current_values).length > 0) {
        jQuery.each(woof_current_values, function(index, value) {
            if (index == 'page' && woof_is_ajax) {
                index = 'paged'
            }
            if (typeof value !== 'undefined') {
                if ((typeof value && value.length > 0) || typeof value == 'number') {
                    if (jQuery.inArray(index, woof_exclude_accept_array) == -1) {
                        link = link + "&" + index + "=" + value
                    }
                }
            }
        })
    }
    link = link.replace(new RegExp(/page\/(\d+)\//), "");
    if (woof_is_ajax) {
        history.pushState({}, "", link)
    }
    return link
}

function woof_show_info_popup(text) {
    if (woof_overlay_skin == 'default') {
        jQuery("#woof_html_buffer").text(text);
        jQuery("#woof_html_buffer").fadeTo(200, 0.9)
    } else {
        switch (woof_overlay_skin) {
            case 'loading-balls':
            case 'loading-bars':
            case 'loading-bubbles':
            case 'loading-cubes':
            case 'loading-cylon':
            case 'loading-spin':
            case 'loading-spinning-bubbles':
            case 'loading-spokes':
                jQuery('body').plainOverlay('show', {
                    progress: function() {
                        return jQuery('<div id="woof_svg_load_container"><img style="height: 100%;width: 100%" src="' + woof_link + 'img/loading-master/' + woof_overlay_skin + '.svg" alt=""></div>')
                    }
                });
                break;
            default:
                jQuery('body').plainOverlay('show', {
                    duration: -1
                });
                break
        }
    }
}

function woof_hide_info_popup() {
    if (woof_overlay_skin == 'default') {
        window.setTimeout(function() {
            jQuery("#woof_html_buffer").fadeOut(400)
        }, 200)
    } else {
        jQuery('body').plainOverlay('hide')
    }
}

function woof_draw_products_top_panel() {
    if (woof_is_ajax) {
        jQuery('#woof_results_by_ajax').prev('.woof_products_top_panel').remove()
    }
    var panel = jQuery('.woof_products_top_panel');
    panel.html('');
    if (Object.keys(woof_current_values).length > 0) {
        panel.show();
        panel.html('<ul></ul>');
        var is_price_in = !1;
        jQuery.each(woof_current_values, function(index, value) {
            if (jQuery.inArray(index, woof_accept_array) == -1 && jQuery.inArray(index.replace("rev_", ""), woof_accept_array) == -1) {
                return
            }
            if ((index == 'min_price' || index == 'max_price') && is_price_in) {
                return
            }
            if ((index == 'min_price' || index == 'max_price') && !is_price_in) {
                is_price_in = !0;
                index = 'price';
                value = woof_lang_pricerange
            }
            value = value.toString().trim();
            if (value.search(',')) {
                value = value.split(',')
            }
            jQuery.each(value, function(i, v) {
                if (index == 'page') {
                    return
                }
                if (index == 'post_type') {
                    return
                }
                var txt = v;
                if (index == 'orderby') {
                    if (woof_lang[v] !== undefined) {
                        txt = woof_lang.orderby + ': ' + woof_lang[v]
                    } else {
                        txt = woof_lang.orderby + ': ' + v
                    }
                } else if (index == 'perpage') {
                    txt = woof_lang.perpage
                } else if (index == 'price') {
                    txt = woof_lang.pricerange
                } else {
                    var is_in_custom = !1;
                    if (Object.keys(woof_lang_custom).length > 0) {
                        jQuery.each(woof_lang_custom, function(i, tt) {
                            if (i == index) {
                                is_in_custom = !0;
                                txt = tt;
                                if (index == 'woof_sku') {
                                    txt += " " + v
                                }
                            }
                        })
                    }
                    if (!is_in_custom) {
                        try {
                            txt = jQuery("input[data-anchor='woof_n_" + index + '_' + v + "']").val()
                        } catch (e) {
                            console.log(e)
                        }
                        if (typeof txt === 'undefined') {
                            txt = v
                        }
                    }
                }
                panel.find('ul').append(jQuery('<li>').append(jQuery('<a>').attr('href', "").attr('data-tax', index).attr('data-slug', v).append(jQuery('<span>').attr('class', 'woof_remove_ppi').append(txt))))
            })
        })
    }
    if (jQuery(panel).find('li').length == 0 || !jQuery('.woof_products_top_panel').length) {
        panel.hide()
    }
    jQuery('.woof_remove_ppi').parent().click(function() {
        var tax = jQuery(this).data('tax');
        var name = jQuery(this).data('slug');
        if (tax != 'price') {
            values = woof_current_values[tax];
            values = values.split(',');
            var tmp = [];
            jQuery.each(values, function(index, value) {
                if (value != name) {
                    tmp.push(value)
                }
            });
            values = tmp;
            if (values.length) {
                woof_current_values[tax] = values.join(',')
            } else {
                delete woof_current_values[tax]
            }
        } else {
            delete woof_current_values.min_price;
            delete woof_current_values.max_price
        }
        woof_ajax_page_num = 1;
        woof_reset_btn_action = !0; {
            woof_submit_link(woof_get_submit_link())
        }
        jQuery('.woof_products_top_panel').find("[data-tax='" + tax + "'][href='" + name + "']").hide(333);
        return !1
    })
}

